  const [ranNum, setRanNum] = useState([])
  
  let tempNum = Math.floor(Math.random() * 20 + 1)
  setRanNum(([prevNum]) => {[prevNum].includes(tempNum)})
  
  
  
  
  
  return (
    <div>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
